    //owl carousel

    function getFormView(idArg) {
        var tableName = $(""#table"" + idArg).val();
        $.ajax({
            url: '/Form/getView',
            type: 'POST',
            dataType: 'json',
            data: {
                getFormId: idArg,
                tableName: tableName
            },
            success: function (data) {
                $(""#formView"").html(data[0]),
                    $(""#formHeading"").html(data[1]);
                $(""#tabName"").html(data[2]);
            },
            error: function (err) {
                console.log(err);
            }
        });
    }

